          <div className="modal-paper">
            <h2 id="transition-modal-title">
              {props.currentCard && <div>{props.currentCard.cardTitle}</div>}
            </h2>
          </div>
        </Fade>
      </Modal>
    </>
  );
}
export default CardModal;
